import './body.css';
import Date from './carte/date';
import Cour from './carte/Cour';
import Navbar from '../Navbar';
import Navbarl from './Navbarl';


function body() {
  return (
    <div className="body">
       <Date />
       <Cour /><Navbar />
       <Navbarl />
        

    </div>
  );
}

export default body;
